import React from "react";
import './header.css';
import Menuresp from './iconemenu.png'

function Header (){

    function menuShow(){
        let menuMobile = document.querySelector('.mobilemenu')
        if (menuMobile.classList.contains('open')){
            menuMobile.classList.remove('open')
            document.querySelector('icon').src ="./components/header/iconemenu.png"
        }else{
            menuMobile.classList.add('open')
        }
    }

    return(
        <div>
           <header>
            <nav className="navbar">
                <div className="name">CARLOS HENRIQUE PIZZI</div>
                    <ul id="menu-h">

                    <a href="#"><li className="navitem">HOME</li></a>

                    <a href="#02"><li className="navitem">PROJETOS</li></a>

                    <a href="#01"><li className="navitem">SOBRE MIM</li></a>

                    <a href="#03"><li className="navitem">CONTATOS</li></a>
                    <div className="iconemobile">
                       <button className="butonmenuresp" onClick={menuShow}><img id="menuresp" src={Menuresp} /></button>
                    </div>
                    </ul>

            </nav>

            <div className="mobilemenu">
                <div className="name">CARLOS HENRIQUE PIZZI</div>
                <ul id="menu-h">

                        <a href="#"><li className="navitem">HOME</li></a>

                        <a href="#02"><li className="navitem">PROJETOS</li></a>

                        <a href="#01"><li className="navitem">SOBRE MIM</li></a>

                        <a href="#03"><li className="navitem">CONTATOS</li></a>

                </ul>
            </div>

           </header>

        </div>
    )
}

export default Header
